import { TopNav, Footer } from "govuk-react";
import "./styles.scss";
import HomePage from "./pages/HomePage";
import ViewAppointment from "./pages/ViewAppointment";
import { BrowserRouter as Router, Link, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="govuk-width-container app-width-container">
      {" "}
      {/* This class centers information */}
      <Link to="/" style={{ color: "white" }}>
        <TopNav.NavLink>Home Page</TopNav.NavLink>
      </Link>
      <Link to="/ViewAppointment" style={{ color: "white" }}>
        <TopNav.NavLink> View / Cancel Appointment</TopNav.NavLink>
      </Link>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/ViewAppointment" element={<ViewAppointment />} />
      </Routes>
      <Footer></Footer>
    </div>
  );
}

export default App;
